'use strict';
const printImmutable = require('./lib/printImmutable');
const IS_MAP = '@@__IMMUTABLE_MAP__@@';
const IS_ORDERED = '@@__IMMUTABLE_ORDERED__@@';
const test = (maybeMap) => !!(maybeMap && maybeMap[IS_MAP] && !maybeMap[IS_ORDERED]);
const print = (val, print, indent, opts, colors) => printImmutable(val, print, indent, opts, colors, 'Map', true);
module.exports = {
  print,
  test
};
